import "./App.css";
import { BrowserRouter } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import HomePage from "./pages/home/HomePage";
import { SWRConfig } from "swr";

function App() {
  return (
    <BrowserRouter>
      <SWRConfig>
        <HomePage />
      </SWRConfig>
    </BrowserRouter>
  );
}

export default App;
